import { generateCdataString, generateNumber, generateRfc3339Date, isObject, trimObject } from "../../../common/utils.js";

//#region src/namespaces/sy/generate/utils.ts
const generateFeed = (feed) => {
	if (!isObject(feed)) return;
	return trimObject({
		"sy:updatePeriod": generateCdataString(feed.updatePeriod),
		"sy:updateFrequency": generateNumber(feed.updateFrequency),
		"sy:updateBase": generateRfc3339Date(feed.updateBase)
	});
};

//#endregion
export { generateFeed };